export default function Navbar() {
  return (
    <>
      <nav className='top-0 left-0 items-center justify-between w-full p-8 px-16 mv:hidden md:flex'>
        <div className='flex items-center cursor-pointer'>
          {/* <img className='w-10 h-10 hover:scale-110 ease-in duration-100' src={smile} alt='home icon' /> */}
        </div>
        <ul
          className={`flex items-center text-paragraph w-96 justify-between font-poppins cursor-pointer`}
        >
          <li className='text-paragraph hover-link'>Item</li>
          <li className='text-paragraph hover-link'>Item</li>
          <li className='text-paragraph hover-link'>Item</li>
          <li className='text-paragraph hover-link'>Item</li>
          <li className='bg-button p-2 text-header text-sm shadow-btn font-poppins tracking-wide cursor-pointer bg-theme text-background contact-btn'>
            Contact
          </li>
        </ul>
      </nav>
      {/* <MobileButton open={open} setOpen={setOpen} />
      <MobileMenu open={open} setOpen={setOpen} /> */}
    </>
  )
}
